import PropTypes from 'prop-types'
import './SignInUp.css'
import Headers from './Headers'
import axios from "axios";
import { Link } from 'react-router-dom';
import React, { Component } from 'react'

class SignInUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      profil: "visiteur",
      email: "",
      password: "",
      loginErrors: "",
      dataEntrepreneur: []
    }
    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleChange = this.handleChange.bind(this);
  }
  handleChangePanelLogin(event) {
    document.getElementById('idPanelLogin').classList.add("is-active");
    document.getElementById('idPanelSignUp').classList.remove("is-active");
  }
  handleChangePanelSignUp(event) {
    document.getElementById('idPanelSignUp').classList.add("is-active");
    document.getElementById('idPanelLogin').classList.remove("is-active");
  }
  handleChange(event) {
    this.setState({
      [event.target.name]: event.target.value
    });
  }

  handleSubmit(event) {
    const { email, password } = this.state;

    axios
      .post(
        "http://localhost:5000/entrepreneur",
        {
          user: {
            email: email,
            password: password
          }
        },
        { withCredentials: true }
      )
      .then(response => {
        if (response.data.logged_in) {
          this.props.handleSuccessfulAuth(response.data);
        }
      })
      .catch(error => {
        console.log("login error", error);
      });
    event.preventDefault();
  }

    render() {
      const {profil, dataEntrepreneur} = this.state
      return (
        <section className="forms-section" id="containerLogSign">
        <Headers profil={profil} onClickLogin={this.onLoginClick} onClickSignUp={this.onSignUpClick} where={"siu"}/>
        <h1 className="section-title"></h1>
        <div className="forms">
          <div id="idPanelLogin" className="form-wrapper is-active">
            <button type="button"  className="switcher switcher-login" onClick={this.handleChangePanelLogin}>
              Login
              <span className="underline"></span>
            </button>
            <form className="form form-login" onSubmit={this.handleSubmit}>
              <fieldset>
                <legend>Please, enter your email and password for login.</legend>
                <div className="input-block">
                  <label>E-mail</label>
                  <input id="login-email" type="email" value={this.state.email} onChange={this.handleChange} required/>
                </div>
                <div className="input-block">
                  <label>Password</label>
                  <input id="login-password" type="password" value={this.state.password} onChange={this.handleChange} required/>
                </div>
              </fieldset>
              <button type="submit" className="btn-login">
              <Link to="/entrepreneur">Login</Link>
              {/*<Entrepreneur dataEntrepreneur={dataEntrepreneur}></Entrepreneur>*/}
              </button>
            </form>
          </div>
          <div id="idPanelSignUp" className="form-wrapper">
            <button type="button"  className="switcher switcher-signup right-panel-active" onClick={this.handleChangePanelSignUp}>
              Sign Up
              <span className="underline"></span>
            </button>
            <form className="form form-signup">
              <fieldset>
                <legend>Please, enter your email, password and password confirmation for sign up.</legend>
                <div className="input-block">
                  <label>E-mail</label>
                  <input id="signup-email" type="email" required/>
                </div>
                <div className="input-block">
                  <label>Password</label>
                  <input id="signup-password" type="password" required/>
                </div>
                <div className="input-block">
                  <label>Confirm password</label>
                  <input id="signup-password-confirm" type="password" required/>
                </div>
              </fieldset>
              <button type="submit" className="btn-signup">Continue</button>
            </form>
          </div>
        </div>
      </section>
      )
    }
  }


  
export default SignInUp
